1540238221),(130,'I am in New York and heading to Texas',560,541,0,0,0,NULL,NULL,1540238260),(131,'Hello Dear Friend,  How are you doing Today? Hope you are in good health.I will like to invest in your Country so i want us to have a mutual agreement on this matter.I will provide the money for the investment. For More details contact me so that i can tell you how to go about it .And i also want you to know that the money in common is in a Bank and i need your assistance in transfering the money to your Account for investment purpose.  I need your assistance in transfering the money to your Country for this investment you will have to choose. I will give you more details on how to go about it.  My email address below  vivi4me@yahoo.com Vivian Traore',569,538,0,0,0,NULL,NULL,1541238670),(132,'Hello Dear Friend,  How are you doing Today? Hope you are in good health.I will like to invest in your Country so i want us to have a mutual agreement on this matter.I will provide the money for the investment. For More details contact me so that i can tell you how to go about it .And i also want you to know that the money in common is in a Bank and i need your assistance in transfering the money to your Account for investment purpose.  I need your assistance in transfering the money to your Country for this investment you will have to choose. I will give you more details on how to go about it.  My email address below  vivi4me@yahoo.com Vivian Traore',569,250,0,0,0,NULL,NULL,1541238703),(133,'Hello Dear Friend,  How are you doing Today? Hope you are in good health.I will like to invest in your Country so i want us to have a mutual agreement on this matter.I will provide the money for the investment. For More details contact me so that i can tell you how to go about it .And i also want you to know that the money in common is in a Bank and i need your assistance in transfering the money to your Account for investment purpose.  I need your assistance in transfering the money to your Country for this investment you will have to choose. I will give you more details on how to go about it.  My email address below  vivi4me@yahoo.com Vivian Traore',569,317,0,0,0,NULL,NULL,1541238715),(134,'Looking for companion for 30 day Caribbean/South America cruise (including Amazon in Brazil) on HAL in November 2019. Might you be interested?',513,548,0,0,0,NULL,NULL,1541353548),(135,'Hello June,  I read your profile and you sound like you sure like to travel.  I am scheduled for a 3 week trip to Southern India and Sri Lanka in January and am looking for a travel buddy.  We would be staying in castles and it would be a pretty high class trip learning about the culture but being very comfortable in the traveling.  What are your thoughts on this,  Patty?',561,538,0,0,0,NULL,NULL,1541357502),(136,'Hello Dear,  I am Charles Jebb a single Father of one from Netherlands but live in California.I really want to be your friend and I believe with time we can fall in love. I am not looking for a one night stand,I am looking for some to spent the rest of my life with.People say that i\'m handsome but you can see that when i send you my pictures.Just know that distance will not be a problem because i can travel to any part of the world to meet my dream woman.  I am looking for a woman who can travel round the world with me because i so much love vacation,Please contact me on this email so that I can send you more details about me and more of my pictures because I don\'t want be on this site for too long due to my busy schedule: charlesjebb01@gmail.com   Thanks you,  Email: charlesjebb01@gmail.com',565,479,0,0,0,NULL,NULL,1541422832),(137,'Hi Claudia',121,540,0,0,0,NULL,NULL,1544029222),(138,'I am in the same boat.   Just donâ€™t like paying a single supplement. ',528,567,0,0,0,NULL,NULL,1547407611),(139,'Hi Lisa, This is Pat Hager at SeniorTravelBuddy.com.  Thanks for signing on to the site.  Please add your photo and other information to your profile.  Thanks so much for signing on to our site.',121,593,0,0,0,NULL,NULL,1548523594),(140,'Hi Lorraine, thanks for signing on to SeniorTravelBuddy.com.  Please fill in your profile and upload a current photo, to get the most out of the site.  Best...Pat Hager, Senior Travel Buddy.',121,599,0,0,0,NULL,NULL,1548869572),(141,'Hi Christine.  Thanks for signing onto SeniorTravelBuddy.com.  Please fill in your complete profile, as well as a current photo.  Any questions, please call me at 858-395-3147 and I\'ll be happy to answer them.  Best...Pat Hager, owner of www.SeniorTravelBuddy.com.',121,600,0,0,0,NULL,NULL,1548952889),(142,'Hi Shirley.  This is Pat, owner of SeniorTravelBuddy.com.  Just wanted to welcome you to the site and thank you for joining.  Please remember to upload a current photo and answer the questions.  This is a new site and users sign up every day.  Please keep checking to find your perfect travel buddy.  ',121,601,0,0,0,NULL,NULL,1549472289),(143,'Hi Jeanne,   This is Pat, owner of SeniorTravelBuddy.com. Just wanted to welcome you to the site and thank you for joining. Please remember to upload a current photo and answer the questions. This is a new site and users sign up every day. Please keep checking to find your perfect travel buddy.',121,602,0,0,0,NULL,NULL,1549472382),(144,'Hi Philip.    This is Pat, owner of SeniorTravelBuddy.com. Just wanted to welcome you to the site and thank you for joining. Please remember to upload a current photo and answer the questions. This is a new site and users sign up every day. Please keep checking to find your perfect travel buddy.',121,604,0,0,0,NULL,NULL,1549472466),(145,'Hi Phyllis, thanks for signing onto SeniorTravelBuddy.com, the site where local seniors can connect with other local seniors to travel together and save money.  Please upload a current photo and fill in the questionnaire so Buddy can help you find a great travel buddy.  The site is very secure and will only be seen by others who sign on.  Thanks, Patricia Hager, owner of SeniorTravelBuddy.com.',121,607,0,0,0,NULL,NULL,1549651710),(146,'Hi Maria, thanks for signing on to Senior Travel Buddy.  Please upload a current photo and fill in the questionnaire so Buddy can find your perfect local travel buddy.  Thanks, Patricia Hager, owner of SeniorTravelBuddy.com.',121,606,0,0,0,NULL,NULL,1549651869),(147,'Hi Kathleen, Thanks for signing up on the site.  Please take advantage of Senior Travel Buddy by uploading a current photo and filling out the questionnaire to help you find your great travel match.  It\'s safe, fun, and free.  Currently, we are running a contest to those who register and fully fill out their profiles and upload a current photo.  A $20 Target card picked at random every week for complete profiles.  Only our admin has your contact information, so it\'s very safe.  Thanks for being a new member.   Patricia Hager, Owner of Se',121,614,0,0,0,NULL,NULL,1549927147),(148,'Hi Sharon.  This is Patricia Hager, owner of Senior Travel Buddy.  Thank you for signing up to our website and for answering the questions in the questionnaire.  It would be very helpful to also upload a current photo onto the site.  It\'s very safe and will be seen by local seniors who want to travel as well.  We have a weekly drawing for a $20 Target card to those who sign up and fill in their complete profiles.  If you would like to participate in the drawing, please upload the photo.  Again, thanks for signing up.  If you have questions, please contact me at seniortravelbuddy@gmail.com.',121,615,0,0,0,NULL,NULL,1550076059),(149,'Good morning, Connie.  Thanks for signing on to Senior Travel Buddy.  Please upload a current photo and fill in the questionnaire.  The contest for a Target gift card ends today where a user will be randomly selected to receive a card if the profile is entirely filled in on the site.  Happy weekend.  Pat, (Buddy\'s mom)...owner of Senior Travel Buddy.com.',121,616,0,0,0,NULL,NULL,1550251730),(150,'Hi Denis, thanks for signing i