INSERT INTO `page_content` VALUES (1,'faq.php','FAQ','<p><span style=\"font-size: 48px;\">FAQs for Senior Travel Buddy Site:</span><br><br><strong><span style=\"font-family: Verdana, Geneva, sans-serif; font-size: 24px;\">How does SeniorTravelBuddy.com work to find a great match to share vacation expenses?</span></strong></p><p><span style=\"font-size: 24px;\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><br>We have been in the travel business for many years, providing great vacations for many age groups. As our client base became older, we were confounded by the lack of resources available to senior travelers, many of whom found themselves single after a long marriage or relationship. These clients are used to traveling together and wish to continue traveling. Consequently, these former travelers were faced with the dilemma of either purchasing expensive double cabins and traveling alone or trying to find a suitable travel companion with whom they could enjoy their vacation experiences as<br>they had in the past.</span></span></p><p><span style=\"font-size: 24px;\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><br><strong>What does double occupancy or single supplement mean when companies quote a fare?</strong></span></span></p><p><span style=\"font-size: 24px;\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><br>In many cases travel suppliers, such as cruise lines and escorted tour companies, offer their fares based on occupancy. It is usually stated as $1000 dd/pp (meaning double occupancy/per person). The single supplement includes pricing for not sharing a cabin or accommodation, stated as sometimes 150% or more of the double cabin pricing or sometimes as a stated rate, such as &ldquo;Please add $1000 for single occupancy.&rdquo; You have come to this site simply to avoid the single supplement, and that&rsquo;s why SeniorTravelBuddy.com was developed.</span></span></p><p><span style=\"font-size: 24px;\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><br><strong>How do I look for a local travel buddy to share a cruise cabin or accommodationthat I will like?</strong></span></span></p><p><span style=\"font-size: 24px;\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><br>Finding a like-minded, same sex, local senior to share your cruise or tour experiences is easy with SeniorTravelBuddy.com. The site will guide you through the process of finding just the right person, one who likes to travel as you do, and one who will share the cost of the cabin or accommodation, saving you both from paying the single supplement required on most cruise lines or tour companies. Granted, many cruise ships and tour companies offer cabin or room sharing when available. But do you want to travel with someone you don&rsquo;t know? Even if you&rsquo;ve emailed them a few times?</span></span></p><p><span style=\"font-size: 24px;\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><br><strong>If I choose a person from the matches available, how will I know whether that buddy is the right person to travel with?</strong></span></span></p><p><span style=\"font-size: 24px;\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><br>That&rsquo;s where your choice comes in. Senior Travel Buddy strongly recommends you communicate with one another in many ways. Once you have established a connection through the website and choose a match that seems to suit you, you will be asked to contact that person, either through email or phone and make a point of getting together to talk over travel plans. SeniorTravelBuddy.com matches same sex travelers who live nearby (in most cases) who are willing to get together for lunch or coffee locally. Once you have met and discovered whether or not you like to travel the same way, then you can choose to meet further or not. It&rsquo;s entirely up to you and your match.</span></span></p><p><span style=\"font-size: 24px;\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><strong>Once we decide we like one another and want to travel together, are we restricted to using Senior Travel Buddy&rsquo;s agency to book trips?</strong></span></span></p><p><span style=\"font-size: 24px;\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><br>Absolutely not. You two can proceed to book your trips anywhere, take any cruise, or go on any tour you like provided you both agree. The fact that you have a senior travel buddy to share your vacations now gives you both the freedom to enjoy any itinerary you like. Just think of it as opening up the world by traveling to any destination without concern for meeting the double occupancy requirements. Of course, you can always use our travel agency located on the landing page under &ldquo;Featured Trips,&rdquo; but this is optional.</span></span></p><p><span style=\"font-size: 24px;\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><br><strong>Why do I have to give so much information on how I like to travel and upload my picture as well?</strong></span></span></p><p><span style=\"font-size: 24px;\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><br>Obviously, the more information you give, the better the match we can make for you. All information given is kept completely private except to those who fit your profile for a match. We do not sell information for advertisers or others. (Please see the disclosure section.) Even then, the questions are subjective, and answering them as fully as you can will result in a much more compatible match for both of you. We use the word compatible because should you and your match become friends, you will enjoy your vacations together so much more. Your vacation styles might differ a bit, but it follows that you will enjoy one another&rsquo;s company.</span></span></p><p><span style=\"font-size: 24px;\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><br><strong>Speaking of becoming friends, is Senior Travel Buddy a dating site?</strong></span></span></p><p><span style=\"font-size: 24px;\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><br>NEVER. Senior Travel Buddy matches only same sex seniors who live near one another. We are NOT a dating site and want to make that perfectly clear.</span></span></p><p><span style=\"font-size: 24px;\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><strong>Knowing that SeniorTravelBuddy.com is a new website, what happens if it cannot find me a match locally right away?</strong></span></span></p><p><span style=\"font-size: 24px;\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><br>Good question. Senior Travel Buddy depends upon a great many subscribers to add to the pool of buddies to make the process work for you. Since we are new, there may be a lag in the responses in your area who would make a good match. Since the subscription fee is very affordable every month, chances are that soon there will be matches that would suit you very well to contact. Our research has shown us that seniors who love to travel (like you) tend to find every opportunity to make that happen so that they can continue to travel as they used to, or in some cases as they become more financially able to do so.<br><br><strong>Suppose that Senior Travel Buddy can&rsquo;t find me a match?</strong></span></span></p><p><span style=\"font-size: 24px;\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><br>Since the subscription fee has no contract, you may unsubscribe at any time. However, we feel that keeping your profile in our system benefits you and helps provide you the matches you may like down the line, even if you have found your perfect travel buddy currently. Even in younger travelers, situations can change, and as we get older, our circumstances sometimes change quickly, leaving us with having to begin a search for another buddy.</span></span></p><p><span style=\"font-size: 24px;\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><br><strong>Suppose I have trouble setting up my account or logging in? Where can I gethelp?</strong></span></span></p><p><span style=\"font-size: 24px;\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><br>Please click on the HELP tab on the landing page for information as to how to get help. The site has been developed to be as easy as possible but sometimes computers don&rsquo;t do what we tell them.</span></span></p><p><span style=\"font-size: 24px;\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><br><strong>Why is a subscription necessary? Can&rsquo;t I do a one-time search? I only need one match for myself.</strong></span></span></p><p><span style=\"font-size: 24px;\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><br>Senior Travel Buddy has determined that to get the best experience in your match search, it is important to have full access to the site whenever you want it for whatever time you want. That&rsquo;s why your account is billed monthly (unless you have already paid for a yearly subscription). Don&rsquo;t forget, if you have found your perfect match, you may cancel your subscription at any time and no more charges will be billed. When you feel you have found your perfect travel match and don&rsquo;t want to keep looking, merely unsubscribe and that&rsquo;s it. It&rsquo;s entirely your choice.</span></span></p><p><span style=\"font-size: 24px;\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><br><strong>How safe is my match?</strong></span></span></p><p><span style=\"font-family: Verdana, Geneva, sans-serif; font-size: 24px;\"><br>Again, Senior Travel Buddy wants you to be completely satisfied with your travel match. That&rsquo;s why we ask you to do your due diligence when meeting your travel match. Be sure to ask the questions you need the answers to. We encourage you to meet in a public place, even though it is local, and you will be of the same gender. SeniorTravelBuddy.com cannot be responsible for any outcomes that don&rsquo;t meet your expectations. It is up to you to discern whether or not you want to continue meeting and discussing travel plans. (Please refer to our disclosure elsewhere on the site.)</span></p>'),(2,'the-experience.php','The Experience','<p style=\"text-align: center;\"><span style=\"font-size: 48px; font-family: Verdana, Geneva, sans-serif;\">The Experience</span></p><p><span style=\"font-family: Verdana,Geneva,sans-serif;\"><span style=\"font-size: 24px;\">Let&rsquo;s face it: You love to travel. You can&rsquo;t wait to explore that place you always hoped to visit or return to. All you need to do is find someone to share your adventure. You for sure don&rsquo;t want to pay that dreaded &lsquo;single supplement&rsquo; for tours, and of course you &nbsp;don&rsquo;t want to pay for an entire cabin on the cruise you have been dreaming of for a longtime.</span></span></p><p><span style=\"font-family: Verdana,Geneva,sans-serif;\"><span style=\"font-size: 24px;\">Wouldn&rsquo;t it be great if you could actually choose a senior, same sex, local traveling partner from a pool of many, selecting only the person who shares your travel style, your age range, level of health, level of activity, financial status and interests? Example: You love gourmet cooking and like to attend cooking classes. Your match can be narrowed down to those who are passionate about cuisine like yourself.</span></span></p><p><span style=\"font-family: Verdana,Geneva,sans-serif;\"><span style=\"font-size: 24px;\">SeniorTravelBuddy.com is NOT A DATING SITE. It matches only same sex travelers who can get together for lunch or coffee to plan trips and talk about their travel likes and dislikes together. We do not advocate any particular trips or travel suppliers, and we do not recommend any destinations or experiences. That is for both of you to decide together. However, there is a tab on the front page called Featured Trips, and there you can find ideas and specials from our travel agency to help you put everything together, but this is entirely optional.</span></span></p><p><span style=\"font-family: Verdana,Geneva,sans-serif;\"><br></span></p><h1 style=\"text-align: center;\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><span style=\"font-size: 48px;\">Single? Senior? Love to Travel?</span></span></h1><h2 style=\"text-align: center;\"><span style=\"font-family: Verdana,Geneva,sans-serif;\">Can&rsquo;t stand paying for the &ldquo;single supplement?&rdquo;</span></h2><p><span style=\"font-family: Verdana, Geneva, sans-serif; font-size: 24px;\">You love to travel. You can&rsquo;t wait to explore that place you always hoped to visit. Now, all you need to do is find someone to share your adventure because you for sure don&rsquo;t want to pay that dreaded &ldquo;single supplement&rdquo; for tours or pay for an entire cabin on the cruise you have been dreaming of for a long time.</span></p><p><span style=\"font-size: 24px;\"><span style=\"font-family: Verdana,Geneva,sans-serif;\">Here are some problems:&nbsp;</span></span></p><p data-empty=\"true\"><span style=\"font-size: 24px;\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><br></span></span></p><ul><li><span style=\"font-size: 24px;\"><span style=\"font-family: Verdana,Geneva,sans-serif;\">You are a senior single, and when you check with the tour company (or preferably your travel agent) they may be able to connect you with a travel mate, a person traveling on the same tour who is in your situation. You cannot control that connection either by age, interests, or any other attribute which is similar to yours, and you must agree to sharing the room or cabin with that person in order to receive the double occupancy pricing. Or, you may spend up to $1000 more for not sharing a room on the tour.</span></span></li><li><span style=\"font-size: 24px;\"><span style=\"font-family: Verdana,Geneva,sans-serif;\">You can book through a singles cruise program, which involves not sharing a room but has a higher booking fare than that of each double occupancy cabin. And you must take the particular cruise that program offers, which may not be your idea of the perfect cruise for you.</span></span></li><li><span style=\"font-size: 24px;\"><span style=\"font-family: Verdana,Geneva,sans-serif;\">You, have particular ways of traveling and don&rsquo;t want to share occupancy with one who does not share your interests or tastes. What if you don&rsquo;t like them?</span></span></li></ul><p><span style=\"font-size: 24px;\"><span style=\"font-family: Verdana,Geneva,sans-serif;\">Wouldn&rsquo;t it be great if you can actually choose a senior local traveling partner from a pool of many, selecting only the person who shares your travel style, your age range, level of health, level of activity, financial status, interests. You get to choose where to travel, travel dates, whatever cruise or tour you like, and with whom you like. In my experience as a travel agent working with many senior clients, this is sometimes the biggest concern they have.</span></span></p><p><span style=\"font-size: 24px;\"><span style=\"font-family: Verdana,Geneva,sans-serif;\">Being the traveler that you are, you should be comfortable with allowing a secure site to filter the data you provide us so we can offer you choices by email. Once you decide which profile might fit your idea of the perfect traveling buddy, it is your choice to contact that person and move forward from there. No contracts, no hassle, no feeling trapped into sharing accommodation with whomever the tour company selects. You are completely free to connect with whomever you want from our database.</span></span></p><p><span style=\"font-size: 24px;\"><span style=\"font-family: Verdana,Geneva,sans-serif;\">It&rsquo;s not rocket science, just plain common sense.</span></span></p><p><span style=\"font-family: Verdana, Geneva, sans-serif; font-size: 24px;\">Using the power of the internet and for a small price, you have solved your travel sharing issues.</span></p>'),(3,'travel-buddies.php','Travel Buddies','<p style=\"text-align: center;\"><span style=\"font-size: 48px; font-family: Verdana, Geneva, sans-serif;\">Travel Buddies</span></p><p><span style=\"font-family: Verdana, Geneva, sans-serif; font-size: 24px;\">This tab is where you start to find your ideal travel buddy. Remember the set of questions you answered on the site when you signed up? These are entirely optional. However, the more detailed information you give us, the better your match will be. It&rsquo;s especially important to upload a CURRENT photo of yourself so you will recognize one another when you first meet up. When you decide on a match, just click on that photo. You will be given that person&rsquo;s name and contact information.</span></p><p><span style=\"font-size: 24px;\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><br>Being the traveler that you are, you should feel comfortable with allowing our secure site to filter the data you provide so we can offer the best choices for you. Once you decide which profile might fit your idea of the perfect travelling buddy, it is your choice to contact that person and move forward from there. No contracts, no hassle, no feeling trapped into sharing accommodation with whomever a tour company selects for you. You are completely free to connect with any one of your matches from our database.</span></span></p><p><span style=\"font-family: Verdana, Geneva, sans-serif; font-size: 24px;\">&nbsp;That&rsquo;s it. It&rsquo;s not rocket science, just plain common sense. Using the power of the internet and for a small monthly rate, you have solved one of your biggest traveling issues, saving money when you travel, and you get a bonus: A new friend to share the adventure.</span></p>'),(4,'featured-trips.php','Featured Trips','<p>Featured Trips</p>'),(5,'how-it-works.php','How It Works','<p style=\"text-align: center;\"><span style=\"font-size: 48px; font-family: Verdana, Geneva, sans-serif;\">How It Works</span></p><p><span style=\"font-size: 24px; font-family: Verdana, Geneva, sans-serif;\">SeniorTravelBuddy.com is a matching site, matching LOCAL SAME SEX SENIOR TRAVELERS who want to find a travel companion to share trips such as cruises and tours but who don&rsquo;t want to pay the single supplement for a cruise cabin or solo accommodation on a tour. Finding a like-minded, same sex, local senior to share your cruise or tour experiences is easy with SeniorTravelBuddy.com. The site will guide you through the process of finding just the right person, one who likes to travel as you do, and one who will share the cost of the cabin or accommodation, each of you saving<br>money.</span></p>');
