INSERT INTO `pages` VALUES (1,'Disclaimer','PURPOSE\r\n\r\nThis website has the purpose of matching seniors of the same sex to other locals who have plans to travel.   SeniorTravelBuddy.com seeks to bring these seniors together by having them choose from a list based upon the answers to multiple questions and a photo, allowing them to select, on their own, the best cruise or tour partner for future vacation plans.  This accomplishes two ideals, the first is to save the single supplement (sometimes costing more than $1000) by sharing a cabin or hotel room.   The second goal is to establish a relationship and rapport with their matches so that seniors who would not consider a solo vacation would happily travel with someone they know, trust, and who has the same travel goals.  We stress that SeniorTravelBuddy.com is NOT a dating site.\r\n\r\n DISCLAIMER\r\nSeniorTravelBuddy.com will match clients of the same gender to share a cabin, and it will try to match roommates based on age similarity, although this is not a guarantee. While we attempt to match roommates as closely as possible, there are always personality differences that may not be apparent from the information collected.  Furthermore, our matches are dependent on the accuracy of the information with which our clients supply us.  We make no independent check of the veracity of the information supplied.  Neither does SeniorTravelBuddy.com conduct any type of background checks on its clients in general, and specifically does not conduct background checks on matching a client with another in a roommate situation.  Once a match has been confirmed, we encourage you to communicate directly with the client matched to you to satisfy any concerns you may have.\r\nSeniorTravelBuddy.com accepts no responsibility for roommate matching incompatibility such as sleep patterns, snoring, noise, or age differences. \r\nSeniorTravelBuddy.com makes no representations or warranties regarding compatibility between roommates. Our roommate matching is strictly for non-smokers - this is for the comfort of all our roommate matches, and it relies on the honor system at booking and common courtesy while onboard. Even if you donâ€™t consider yourself a regular smoker, if you do choose to smoke in any areas not designated for smoking during the cruise or vacation, then you will not have the option of using our roommate matching on any future cruises.\r\nUnder no circumstances will SeniorTravelBuddy.com be liable for any damages whatsoever, whether direct, indirect, general, special, compensatory, consequential, and/or incidental, including without limitation bodily injury, emotional distress, harassment, and defamation arising out of or relating to the conduct of any client or guest action or interaction between clients or guests, or any actions by the service providers such as cruise lines, hotels, restaurants, or tours booked on your behalf.  \r\n\r\nPrivacy Policy:\r\n\r\nThis privacy policy (this â€œPolicy) describes the practices of SeniorTravelBuddy, with respect to our collection, use, storage, and disclosure of personal information provided to us from users of our Website.  This Policy forms an integral part of Terms of Use Agreement, which is incorporated by reference.\r\n\r\nAll references to â€œWebsiteâ€ in this Policy refer to our websites located at www. SeniorTravelBuddy.com.\r\n\r\nINTRODUCTION\r\n\r\nWe respect and uphold individual rights to privacy and the protection of personal information.  We know how important it is to protect Your personal information and want to make every customer experience safe and secure.  In keeping with that goal, we use SSL encryption on our whole site and ensure our employees are trained on the importance of maintaining the security and confidentiality of personal information.   However, no system can be completely secure.  While SeniorTravelBuddy.com takes steps to secure Your information, we do not promise, and You should not expect, that Your personal information will always remain secure.\r\n\r\nFor the purpose of this Policy, â€œpersonal informationâ€ means information about an identifiable individual, including, for example, an individualâ€™s height, birth date, name, home address, telephone number, social security number, sex, income, and marital status.  We will only collect, use, or disclose personal information in accordance with this Policy, or in accordance with laws applicable to the collection, use and disclosure of Your personal information by us.\r\n\r\nCOLLECTION AND USE OF PERSONAL INFORMATION\r\n\r\nWhen you choose to provide us with your personal information, You consent to the use of Your personal information as identified in this Policy and as may be further identified at the time of collection.\r\n\r\nWe collect two types of information through our Website:  personal information and non-personal information.   The types of information we collect depend on the nature of your interaction with us.  \r\n\r\nPERSONAL INFORMATION\r\n\r\nWe may collect personal information such as:\r\n\r\n1.	Your contact information â€“ for example, Your name and email address;\r\n2.	Your personal preferences â€“ for example, language preference and marketing consent; and\r\n3.	Your profile information â€“ for example, photographs You upload and other information You provide in your personal profile, such as Your interests, marital status, Your height, weight and occupation.\r\n\r\nNON-PERSONAL INFORMATION\r\n\r\nNon-personal information does not identify You as an individual.  For example:\r\n\r\n1.	We may collect certain non-personal data when You visit our Website, such as the type of browser You are using or the referring URL; or\r\n2.	We may collect and summarize customer information in a non-personal, aggregate format for statistical and research purposes.  \r\n\r\nYou may choose not to provide us with Your personal information.  However, if You make this choice, we may not be able to provide You with the service or information that You requested.  For example, we require your email address in order to verify Your account, which is necessary so that notifications may be sent to you electronically.  Should You no longer wish to receive notifications from SeniorTravelBuddy.com when You receive a message from another SeniorTravelBuddy.com user or when another user adds You as a favorite, You may turn these notifications off through Mail Settings.  (SeniorTravelBuddy.com will not send You notifications after Your account is deleted.)\r\n\r\nUSE OF PERSONAL INFORMATION\r\n\r\nWe may use your personal information for a number of different business purposes, for example, to:\r\n\r\n1.	create and display Your online travel profile to other users of the Website;\r\n2.	show other users when You have viewed their profiles;\r\n3.	compare Your profile and preferences with that of other users to provide both You and other users with potential matches;\r\n4.	provide customer support to assist you with your questions or complaints;\r\n5.	advise You of changes to our service or new services that we may implement from time to time;\r\n6.	measure and improve the effectiveness of our Website or our marketing endeavors;\r\n7.	detect and protect against fraud and error;\r\n8.	track and analyze Your preferences to better understand Your service needs and eligibility; and\r\n9.	for other purposes as described in this Policy.\r\n\r\nWe limit the personal information we collect and use to that which is necessary to fulfill our business purposes.   We will not collect, sell, distribute or use personal information for any other purposes without Your further consent, except to the extent as required by law or as authorized by Applicable Privacy Law.\r\n\r\nYOUR CONSENT\r\n\r\nExpress Consent\r\n\r\nSometimes you will be asked to give Your express consent to our collection, use, or disclosure of personal information â€“ for example, by being asked to check a box to indicate Your consent to receive marketing communications.\r\n\r\nImplied Consent\r\n\r\nOther times, You may provide Your implied consent to our collection, use, or disclosure of personal information when we can reasonably conclude that You have given consent by some action You have taken or an action You have decided not to take.  Generally, this occurs where the purpose for the use of Your personal information would be reasonably apparent to You â€“ for example, when You provide us with personal information through forms to populate Your online travel profile, You provide us with implied consent to publish that information for other users of the Website to view.\r\n\r\n\r\nWithdrawing Your Consent\r\n\r\nYou may notify us at any time that You wish to withdraw or change Your consent to our use and disclosure of Your information.  We will accommodate Your request subject to legal and contractual restrictions.\r\n\r\nINFORMATION WE MAY COLLECT DIRECTLY FROM YOU\r\n\r\nListed here are some further examples of the way that we collect personal information directly from You and how we use it.\r\n\r\nFollow-Up and Website News and Specials\r\n\r\nFrom time to time, we may send You a follow-up letter to thank You for Your use of the Website, or we may contact You to ensure that You are completely satisfied.  You have the choice of subscribing to our periodical newsletter which will inform you of special events, special discounts and general information.  You do not need to be a member to subscribe to the newsletter.   You can unsubscribe to the newsletter at any time.\r\n\r\nOur Website\r\n\r\nOur Website can be browsed anonymously.   However, to engage in certain special features or functions of our Website, You may be asked to provide certain personal information, such as Your email address or demographic information.  We use this information to create Your account, contact and correspond with You about your account, respond to Your inquiries, and monitor functions of our Website that You choose to use.\r\n\r\nMatching\r\n\r\nFrom time to time we will use some elements of Your personal information (such as Your personal preferences or Your profile information) to generate and send you a list of possible matches from among our other users.\r\n\r\nWeb Site Tracking Information\r\n\r\nWe utilize Google Analytics and its User ID function in the collection, tracking, compilation, and analysis of information, which allows us to track your use of our Website across multiple devices.  This tracking information is used to create reports regarding our website user demographics, website traffic patterns, and website purchases.  None of the tracking information in these reports can be connected to the identities or other personal information of individual users.   For our own research purposes, we may link tracking information with personal information voluntarily provided by Website users.   Once such a link is made, all of the linked information is treated as personal information and will be used and disclosed only in accordance with this Policy.  More information on Google Analytics may be found at http://www.google.com/analytics (http://www.google.com/analytics/), as amended by Google from time to time.\r\n\r\nLinks to Other Websites\r\n\r\nOur website may contain links to other websites or Internet resource which are provided solely for Your convenience and information.  When You click on one of those links You are contacting another website or internet resource.    We have no responsibility or liability for, or control over, those other websites or internet resources or their collection, use and disclosure of Your personal information.   We encourage You to read the privacy policies of those other websites to learn how they collect and use Your personal information.\r\n\r\nSUPPLEMENTING INFORMATION\r\n\r\nFrom time to time we may supplement information You give us with information from other sources, such as information validating Your address or other available information You have provided us.  This is to help us maintain the accuracy of the information we collect and to help us provide better service such as shipping addresses.\r\n\r\nDISCLOSURE AND SHARING OF YOUR INFORMATION\r\n\r\nWe do not sell or license Your personal information to any other party.\r\n\r\nWe may use third party service providers (for example, web hosting providers, data management providers and/or payment processors (Pay Pal) to manage one of more aspects of our business operations, including the processing or handling of personal information.   When we do use an outside company, we use contractual or other appropriate means to ensure that Your personal information is used in a manner that is consistent with this Policy.\r\n\r\nWe may disclose your information as permitted or required by law.  For example, we may be compelled to release information by a court of law or other person or entity with jurisdiction to compel production of such information.  If we have reasonable grounds to believe information could be useful in the investigation of improper or unlawful activity, we may disclose information to law enforcement agencies or other appropriate investigative bodies.\r\n\r\nSECURITY OF PERSONAL INFORMATION\r\n\r\nThe security of Your personal information is a high priority for us.  We maintain appropriate safeguards and current security standards to protect Your personal information, whether recorded on paper or captured electronically, against unauthorized access, disclosure, or misuse.  For example, we use SSL encryption on our whole site and ensure our employees are trained on the importance of maintaining the security and confidentiality of personal information.   However, no system can be completely secure.  While SeniorTravelBuddy.com takes steps to secure Your information, we do not promise, and you should not expect, that Your personal information will always remain secure.\r\n\r\nREQUESTS FOR ACCESS TO AND CORRECTION OF PERSONAL INFORMATION\r\n\r\nApplicable Privacy Laws allows any individual the right to access and/or request the correction of errors or omissions in his or her personal information that is in our custody or under our control.   For security purposes, not all personal information is accessible and amendable.  If access or corrections cannot be provided, we will notify the individual making the request within 30 days, in writing, of the reasons for the refusal.\r\n\r\nDIGITAL MILLENNIUM COPYRIGHT ACT NOTICE\r\n\r\nIf you believe Your copyrighted work has been copied in a way that constitutes copyright infringement and is accessible on this Site, please notify SeniorTravelBuddyâ€™s copyright agent, as set forth in the Digital Millennium Copyright Act of 1998 (DMCA).   For your complaint to be valid under the DMCA, You must provide the following information in writing:\r\n\r\n1.	An electronic or physical signature of a person authorized to act on behalf of the copyright owner;\r\n2.	Identification of the copyrighted work that Your claim is being infringed;\r\n3.	Identification of the material that is claimed to be infringing and where it is located on the site.\r\n4.	Information reasonably sufficient to permit SeniorTravelBuddy to contact you, such as Your address, telephone number, and email address;\r\n5.	A statement that you have good faith belief that use of the material in the manner complained of is not authorized by the copyright owner, its agent, or law; and\r\n6.	A statement made under penalty of perjury that the above information is accurate, and that you are the copyright owner or are authorized to act on behalf of the owner.\r\n\r\nUnder no circumstances will SeniorTravelBuddy.com be liable for any damages whatsoever, whether direct, indirect, general, special, compensatory, consequential, and/or incidental, including without limitation bodily injury, emotional distress, harassment, and defamation arising out of or relating to the conduct of any subscriber or guest, action or interaction between subscribers or guests, or any actions by the service providers such as cruise lines, hotels, restaurants, or tours booked on your behalf.  '),(2,'About Us','<p style=\"text-align: center;\"><span style=\"font-size: 48px; font-family: Verdana, Geneva, sans-serif;\">Travel Buddies</span></p>\r\n\r\n<p><span style=\"font-family: Verdana, Geneva, sans-serif; font-size: 24px;\">This tab is where you start to find your ideal travel buddy. Remember the set of questions you answered on the site when you signed up? These are entirely optional. However, the more detailed information you give us, the better your match will be. Itâ€™s especially important to upload a CURRENT photo of yourself so you will recognize one another when you first meet up. When you decide on a match, just click on that photo. You will be given that personâ€™s name and contact information.</span></p>\r\n\r\n<p><span style=\"font-size: 24px;\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><br>Being the traveler that you are, you should feel comfortable with allowing our secure site to filter the data you provide so we can offer the best choices for you. Once you decide which profile might fit your idea of the perfect travelling buddy, it is your choice to contact that person and move forward from there. No contracts, no hassle, no feeling trapped into sharing accommodation with whomever a tour company selects for you. You are completely free to connect with any one of your matches from our database.</span></span>\r\n</p>\r\n\r\n<p><span style=\"font-family: Verdana, Geneva, sans-serif; font-size: 24px;\">Â Thatâ€™s it. Itâ€™s not rocket science, just plain common sense. Using the power of the internet and for a small monthly rate, you have solved one of your biggest traveling issues, saving money when you travel, and you get a bonus: A new friend to share the adventure.</span></p>\r\n'),(3,'Contact Us','<h3 class=\"text-center\">Contact Us</h3><br />\r\n<h6 class=\"text-center\">Have Questions? Comments?</h6><br />\r\n<p class=\"text-center\">We understand that you may have questions about your experience on Senior Travel Buddy. <br /><br />Whether it be about the website, your Subscription, or anything else, please send your questions by <u><a href=\"mailto:pathagertravel@gmail.com\">CLICKING HERE</a></u> and we will get back to you as soon as we can!</p>\r\n<h6 class=\"text-center\">Thank you!</h6>');
